import getBundle from './cm3-nsi-hexbin-bundle';

const cm3NsiHexBinPlugin={
    pluginName: 'NSI HexBin Plugin',
    enabled: true,
    bundle: getBundle,
    components:[]
  }


export {cm3NsiHexBinPlugin as default}
